INSERT INTO recipe (name, preparation, image) VALUES ('Ensalada mixta', 'Picar todos los ingredientes en rodajas finas y mezclarlos. Sal y pimienta al gusto y a comer.', 
INSERT INTO recipe (name, preparation, image) VALUES ('Pasta Bologña', 'Picamos las verduras. Las pochamos con aceite de oliva durante diez minutos a fuego lento. Añadimos la carne picada. Después agregamos el tomate picado en trozos un vaso de agua y el concentrado de tomate, dejando que todo se cocine durante unos veinte minutos más. Servir sobre la pasta.', UNHEX(''));
INSERT INTO recipe (name, preparation, image) VALUES ('Arroz con pollo', 'Comenzamos pochando las verduras a fuego lento en una sartén con un poco de aceite de oliva virgen extra. Las tendremos unos 15 minutos a fuego suave. Pasado el tiempo añadimos el pollo troceado, yo en este caso he usado pechuga de pollo. La salpimentamos y la doramos con las verduras.  Seguidamente añadimos el pimiento choricero y el tomate junto con el arroz. Subimos el fuego para anacarar el arroz. Ahora es momento de cubrir con caldo, ponemos 3 veces la cantidad de arroz, añadimos colorante o azafrán y dejamos cocinar 4 minutos a fuego fuerte y luego 15 minutos más a fuego lento. Cuando este cocinado el arroz, dejamos reposar unos minutos y a disfrutar un receta de arroz con pollo perfecta.' , UNHEX (''));
INSERT INTO recipe (name, preparation, image) VALUES ('Brocoli Gratinado', 'Poner el brócoli cortado en “arbolitos” en agua hirviendo. Dejar unos 5-7 minutos, hasta que tenga ese color fluorescente. Escurrir y reservar. Picar el ajo y saltearlo en la manteca. Agregar el brócoli y saltear unos minutos, para que tome el sabor del ajo. Agregar las cucharadas de harina y mover con el fuego a medio. Agregar el chorro de leche. Una vez que esté con la consistencia que queremos, apagar el fuego. Colocar el brócoli en una fuente de horno, esparcir el queso fresco. Llevar a horno o gratinador hasta que la superficie de arriba esté dorada. ¡Listo! ya tenés tu brócoli gratinado.', UNHEX (''));
INSERT INTO recipe (name, preparation, image) VALUES ('Huevos revueltos con tostadas y tomate', 'Echamos los huevos a la sartén caliente y removemos constantemente y de forma envolvente con una cuchara de madera. Apagamos el fuego y veremos el huevo que se sigue cocinado porque la sartén está aún caliente, retiramos a un plato.', UNHEX (''));
INSERT INTO recipe (name, preparation, image) VALUES ('Ensalada de fruta', 'Picamos todas las frutas, servir en un bowl y estara lista tu ensalada para comer',  UNHEX(''));
INSERT INTO recipe (name, preparation, image) VALUES ('Yogurt con granola y fresas', 'Picamos las fresas. Servimos en un bowl. Agregamos el yogurt y la granola y estara lista tu merienda saludable', UNHEX(''));
INSERT INTO recipe (name, preparation, image) VALUES ('Sándwich de pavo y tomate', 'Abrimos el pan. Agregamos el pavo. Picamos el tomate y agregamos al pan.', UNHEX(''));
INSERT INTO recipe (name, preparation, image) VALUES ('Pescado con esparragos y zanahoria', ' Coloca la zanahoria en una olla con agua hirviendo y cocina durante 15 minutos. Retírala del agua y pártela en mitades. Coloca la zanahoria sobre una bandeja para hornear junto con el filete de pescado y los espárragos.Parte un diente de ajo en rodajas y colócalas encima del pescado. Pica el perejil y agrégalo encima. Por último, vierte el aceite de oliva encima. Hornea durante 30 minutos a 250°C, volteando los ingredientes a los 15 minutos para que se cocine de manera uniforme. Sirve y disfruta.', UNHEX(''));
